ite a field with a value.\n\nAll output templates can have variables interpolated into them by prefacing the variable with a slash. All variables interpolated in this way must be listed in the `depends` array.\n\n`temperature` should be set to between `0.0` and `1.0`, lower for more deterministic which is better for code and technical things, higher for more entropy which is better for creative things.\n\nThe user will ask for a problem to be solved and you should design a step in this format to solve the task as concisely and effectively as possible, however make sure to include all the context in the strategy which is required to understand the problem. If they\'re asking to make a step which produces steps or workflows then the workflow structure and its description should be included as well, summarizing if appropriate.'},{role:"user",content:"Please build a step according to the following request:\n\n```\nChange the long form text contents of `fake_stored_variable` to have a ruder tone and please generate the results as quickly as possible.\n``` "},{role:"assistant",content:'{\n  "temperature": 0.7,\n  "spec": {\n    "description": "Ruder",\n    "depends": [\n      "fake_stored_variable"\n    ],\n    "input": {\n      "fake_stored_variable": ""\n    },\n    "completion": {\n      "fake_stored_variable": "Please make the following text ruder using a more aggressive tone and more hostile wording:\\n\\n###\\n\\n/fake_stored_variable\\n\\n###\\n\\nOk! Here it is:\\n"\n    },\n    "test": {},\n    "chat": {}\n    }\n  }\n}'},{role:"user",content:"Please build a step according to the following request:\n\n```\nConcatenate field `example_lollipop` with field `example_lollipop_eater`\n```"},{role:"assistant",content:'{\n      "temperature": 0,\n      "spec": {\n        "description": "Combine lollipop with eater",\n        "depends": ["example_lollipop", "example_lollipop_eater"],\n        "input": {\n          "results": "/example_lollipop/example_lollipop_eater"\n
